  TOGGLE_VIEW,LABEL_ID,

} from "../Redux/actionType";

export const initialState = {
  view:true,
  labelid:''

};

const reducer = (State = initialState, action) => {
  switch (action.type) {


    case LABEL_ID: {
      return {
        ...State,
        labelid: action.payload
      };
    }


    // case TOGGLE_VIEW: {
